member.param:
A list of associations to set. Each of them has:
            * name: string, optional - name of the association to set;
            * id1: int64, object identifier 1;
            * id2: int64, object identifier 2;
            * data: string, optional - an arbitrary data (max. 255 characters) to store with this association.
            * time: integer, optional - default to association creation time. A timestamp to store with this association. This timestamp is represented as number of seconds since the Unix Epoch (January 1 1970 00:00:00 GMT).

A list of associations to remove. Each of them has:
            * name: string, optional - name of the association;
            * id1: int64, object identifier 1;
            * id2: int64, object identifier 2;

member.returns:
A list of associations, each of which has:
            * name: name of the association to set;
            * id1: object identifier 1;
            * id2: object identifier 2;
            * data: arbitrary information stored with this association; and
            * time: association creation time or a timestamp that was stored with this association.
